import React from "react";

import Books from "./Books";
import Ebooks from "./Ebooks";
import Borrowed from "./Borrowed";
import Wishlist from "./Wishlist";

export default function Main() {

    return(
        <>
            <div className="books-container">
                <Books img src="images/books.svg" alt="książki"/>
            </div>
            <div className="books-container">
                <Books img src="images/books.svg" alt="książki"/>
                <h2>ebooki</h2>
                <p>sprawdź, co już masz na kindlu</p>
            </div>
            <div className="borrowed-container">
                <Books img src="images/borrowed.png" alt="wypożyczone"/>
                <h2>wypożyczone</h2>
                <p>zapisz, żeby nie zapomnieć</p>
            </div>
            <div className="wishlist-container">
                <Books img src="images/heart.png" alt="wishlista"/>
                <h2>wishlist</h2>
                <p>zapamiętaj, co chcesz kupić</p>
            </div>
        </>
    )
};
